INSERT INTO `v1_1c04dafb7c972bd1aba605993daa3c65ac795439d53d07d1c491587ff1e89085` VALUES (35, 0, 30000, 24001, 0, 1, 0, "", 2, "", 15);
INSERT INTO `v1_1c04dafb7c972bd1aba605993daa3c65ac795439d53d07d1c491587ff1e89085` VALUES (36, 0, 40000, 91002, 0, 100, 0, "", 8, "", 1);
INSERT INTO `v1_1c04dafb7c972bd1aba605993daa3c65ac795439d53d07d1c491587ff1e89085` VALUES (37, 107501, 40001, 91002, 1, 150, 0, "今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪", 8, "ぺコリーヌ", 1);
INSERT INTO `v1_1c04dafb7c972bd1aba605993daa3c65ac795439d53d07d1c491587ff1e89085` VALUES (38, 107601, 40001, 91002, 1, 150, 0, "この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪", 8, "コッコロ", 2);
INSERT INTO `v1_1c04dafb7c972bd1aba605993daa3c65ac795439d53d07d1c491587ff1e89085` VALUES (39, 107801, 40001, 91002, 1, 150, 0, "あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪", 8, "キャル", 3);
INSERT INTO `v1_1c04dafb7c972bd1aba605993daa3c65ac795439d53d07d1c491587ff1e89085` VALUES (40, 107701, 40001, 91002, 1, 150, 0, "あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！", 8, "スズメ", 4);
INSERT INTO `v1_1c04dafb7c972bd1aba605993daa3c65ac795439d53d07d1c491587ff1e89085` VALUES (41, 107901, 40001, 91002, 1, 150, 0, "今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪", 8, "タマキ", 5);
INSERT INTO `v1_1c04dafb7c972bd1aba605993daa3c65ac795439d53d07d1c491587ff1e89085` VALUES (42, 107501, 40001, 91002, 2, 150, 0, "う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪", 8, "ぺコリーヌ", 6);
INSERT INTO `v1_1c04dafb7c972bd1aba605993daa3c65ac795439d53d07d1c491587ff1e89085` VALUES (43, 107601, 40001, 91002, 2, 150, 0, "夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ", 8, "コッコロ", 7);
INSERT INTO `v1_1c04dafb7c972bd1aba605993daa3c65ac795439d53d07d1c491587ff1e89085` VALUES (44, 107801, 40001, 91002, 2, 150, 0, "ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！", 8, "キャル", 8);
INSERT INTO `v1_1c04dafb7c972bd1aba605993daa3c65ac795439d53d07d1c491587ff1e89085` VALUES (45, 107701, 40001, 91002, 2, 150, 0, "あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪", 8, "スズメ", 9);
INSERT INTO `v1_1c04dafb7c972bd1aba605993daa3c65ac795439d53d07d1c491587ff1e89085` VALUES (46, 107901, 40001, 91002, 2, 150, 0, "夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？", 8, "タマキ", 10);
