INSERT INTO `v1_1c04dafb7c972bd1aba605993daa3c65ac795439d53d07d1c491587ff1e89085` VALUES (322, 126001, 40011, 24001, 1, 1, 0, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 2, "クリア", 2);
INSERT INTO `v1_1c04dafb7c972bd1aba605993daa3c65ac795439d53d07d1c491587ff1e89085` VALUES (323, 126101, 40011, 24001, 1, 1, 0, "んーと。\nこれ、あげる。\nはい", 2, "プレシア", 3);
INSERT INTO `v1_1c04dafb7c972bd1aba605993daa3c65ac795439d53d07d1c491587ff1e89085` VALUES (324, 125801, 40011, 24001, 2, 1, 0, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 2, "リリ", 4);
INSERT INTO `v1_1c04dafb7c972bd1aba605993daa3c65ac795439d53d07d1c491587ff1e89085` VALUES (325, 126001, 40011, 24001, 2, 1, 0, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 2, "クリア", 5);
INSERT INTO `v1_1c04dafb7c972bd1aba605993daa3c65ac795439d53d07d1c491587ff1e89085` VALUES (326, 126101, 40011, 24001, 2, 1, 0, "お兄。\nきてくれて、うれしい", 2, "プレシア", 6);
